def naloga4(t):
    t = t[:]
    p = []
    for i in range(0, len(t) - 1):
        j = i
        for k in range(i + 1, len(t)):
            if t[k] < t[j]: j = k
        (t[i],t[j]) = (t[j], t[i])
        if i != j: p.append((i,j))
    return p

