polinom <- function(v, x) {
  # dokler je prvi koeficient niceln, ga brisemo
  while (v[1] == 0) v <- v[-1]
  izpis <- ""
  # stopnja polinoma je enaka stevilu koeficientov
  stopnja <- length(v)

  for (i in 1 : stopnja) {
    k <- v[i]
    stevilo <- abs(k)
    potenca <- stopnja - i

    # ce je koeficient enak 0, gremo na naslednji clen
    if (k == 0)
      next

    # zapisemo predznak
    # ce je clen prvi, ne izpisemo plusa in ne dodamo presledkov
    if (i == 1) {
      if (k < 0)
        izpis <- paste(izpis, "-", sep = "")
    } else {
      if (k < 0)
        izpis <- paste(izpis, " - ", sep = "")
      else
        izpis <- paste(izpis, " + ", sep = "")
    }

    # ce koeficient ni 1 ali -1 ali pa je clen zadnji, ga izpisemo
    if (potenca == 0)
      izpis <- paste(izpis, stevilo, sep = "")
    else if (stevilo != 1)
      izpis <- paste(izpis, stevilo, " ", sep = "")

    # dodamo spremenljivko in potenco, ce je ta potrebna
    if (potenca > 1)
      izpis <- paste(izpis, x, "^", potenca, sep = "")
    else if (potenca == 1)
      izpis <- paste(izpis, x, sep = "")

  }

  return(izpis)
}

