        for c in vrstica:
            c=' ' if c.isspace() else c.upper()
            if c.isalpha() or c.isspace(): # če je črka ali presledek, jo damo v slovar
                slovar[c] = slovar.get(c,0)+1
                st+=1
    f.close()
    dolzinaBesede=st/(slovar.get(" ",0)+1)
