class Polinom:

    def __init__(self, koef):
        # že na začetku se znebimo vseh ničelnih vodilnih koeficientov
        zadnji = len(koef)
        while zadnji > 0 and koef[zadnji - 1] == 0: zadnji -= 1
        self.koef = koef[:zadnji]































    def __repr__(self):
        from re import sub
        def monom(a, n):
            monom = "{0} x^{1}".format(a, n)
            # popravimo potence in koeficiente
            monom = sub("\^1$", "", monom) # ^1 pobrišemo le na koncu niza
            monom = sub(" x\^0", "", monom) # pobrišemo presledek pred x^0
            monom = sub("^1 x", "x", monom) # 1 mora biti na začetku monoma
            monom = sub("-1 x", "-x", monom)
            return monom

        # "seštejemo" vse momone z neničelnimi koeficienti
        # pred tem moramo koeficiente obrniti v vrstni red kot v izpisu
        niz = " + ".join(reversed([monom(a, n)
                         for n, a in enumerate(self.koef) if a != 0]))
        niz = sub("\+ -", "- ", niz) # popravimo negativne koeficiente

        if niz: return niz # če smo dobili niz, ga vrnemo
        else: return "0" # sicer prazen polinom izpišemo kot ničelnega

    def stopnja(self):
        if self.koef: return len(self.koef) - 1
        else: return -float("inf")

    def __add__(self, other):
        # predpostavimo, da ima levi polinom vsaj toliko členov kot desni
        if len(self.koef) < len(other.koef): return other + self

        # nato vzamemo levi polinom in kosoma prištevamo desnega
        koef_vsote = self.koef
        for n, a in enumerate(other.koef):
            koef_vsote[n] += a

        return Polinom(koef_vsote)

    def __mul__(self, other):
        # če je eden od polinomov ničelen, je ničelen tudi produkt
        if not self.koef or not other.koef: return Polinom([])

        # oba polinoma z ničlami podaljšamo do iste dolžine
        levi = self.koef + len(other.koef) * [0]
        desni = other.koef + len(self.koef) * [0]

        koef_prod = [
            sum(levi[i] * desni[n - i] for i in range(n + 1))
            for n in range(len(levi))
        ]
        return Polinom(koef_prod)

