def floydWarshall(g):
    raz = {u: {v: float("inf") for v in g} for u in g}
    for u in raz:
        raz[u][u] = 0
    for u in g:
        for v in g:
            if v in g[u]:
                raz[u][v] = g[u][v]
    for u in g:
        for v in g:
            for w in g:
                raz[v][w] = min(raz[v][w], raz[v][u] + raz[u][w])
    return raz

