def premeci(a, i, j):
    p = i
    i += 1
    while i < j:
        while i < j and a[i] < a[p]:
            i += 1
        while i < j and a[p] < a[j]:
            j -= 1
        a[i], a[j] = a[j], a[i]
    if a[i] < a[p]:
        a[p], a[i] = a[i], a[p]
        return i
    else:
        a[p], a[i - 1] = a[i - 1], a[p]
        return i - 1

def uredi(a, i, j, k, pravi):
    if i == j:
        pravi[i] = True
    elif j - i + 1 <= k // 2:
        return
    else:
        p = premeci(a, i, j)
        pravi[p] = True
        uredi(a, i, p - 1, k, pravi)
        uredi(a, p + 1, j, k, pravi)

