class Ulomek:
    def __init__(self, st, im):
        if im < 0:
            st, im = -st, -im
        d = gcd(st, im)
        self.st = st // d
        self.im = im // d

    def __repr__(self):
        return "{0}/{1}".format(self.st, self.im)

    def __eq__(self, other):
        return self.st == other.st and self.im == other.im

    def __add__(self, other):
        a, b = self.st, self.im
        c, d = other.st, other.im
        return Ulomek(a * d + b * c, b * d)

    def __sub__(self, other):
        a, b = self.st, self.im
        c, d = other.st, other.im
        return Ulomek(a * d - b * c, b * d)

    def __mul__(self, other):
        a, b = self.st, self.im
        c, d = other.st, other.im
        return Ulomek(a * c, b * d)

    def __truediv__(self, other):
        a, b = self.st, self.im
        c, d = other.st, other.im
        return Ulomek(a * d, b * c)

