cas.cakanja <- function(a, b, t, k = 1000) {
  poskus <- function() {
    # povprečen razmak je (b - a) / 2,
    # zato v povprečju čakamo na 2 * t / (b - a) avtobusov.
    st.avtobusov <- 2 * ceiling(t / (b - a))
    razmaki <- runif(st.avtobusov)
    # če po pričakovanem številu avtobusov še vedno ni avtobusa,
    # čakamo še naprej ter povečujemo čas čakanja.
    repeat {
      razmaki <- runif(st.avtobusov)
      cas.do.zadnjega <- sum(razmaki)
      if(t < cas.do.zadnjega)
        break
      else
        t <- t - cas.do.zadnjega
    }
    prihodi <- cumsum(razmaki)
    return(min(prihodi[prihodi > t]) - t)
  }
  return(mean(replicate(k, poskus())))
