    """Reši dani sudoku. Vrni rešitev, ali None, če je sudoku nerešljiv."""

    def sestopaj(p):
        """S sestopanjem reši sudoku t, pri čemer je p seznam še nezapolnjenih polj."""
        if len(p) == 0:
            # Zapolnili smo vse, sudoku je rešen
            return True
        else:
            # V seznamu potez p poiščemo tisto, ki ima najmanj možnih polj
