    while i < len(sez_l) and j < len(sez_r):
        if sez_l[i] <= sez_r[j]:
            sez.append(sez_l[i])
            i += 1
        else:
            sez.append(sez_r[j])
            j += 1
            inv += len(sez_l) - i
    sez += sez_l[i:] + sez_r[j:]
