    def pomozna(a):
        if len(a) <= 1:
            return a, 0
        else:
            k = len(a) // 2
            sez_l, inv_l = pomozna(a[:k])
            sez_r, inv_r = pomozna(a[k:])
            sez, inv = zlij(sez_l, sez_r)
            return sez, inv_l + inv_r + inv
    _, inv = pomozna(a)
    return inv

