class Datum:
    def __init__(self, dan, mesec, leto):
        self.dan = dan
        self.mesec = mesec
        self.leto = leto








































    def __repr__(self):
        return "{0}. {1}. {2}".format(self.dan, self.mesec, self.leto)

    def jeVeljaven(self):
        return 1 <= self.mesec <= 12 \
               and 1 <= self.dan <= dolzineMesecev(self.leto)[self.mesec - 1]

    def __lt__(self, other):
        # uporabimo kar Pythonovo vgrajeno leksikografsko primerjavo
        return (self.leto, self.mesec, self.dan) \
               < (other.leto, other.mesec, other.dan)

    def __eq__(self, other):
        # uporabimo kar Pythonovo vgrajeno leksikografsko primerjavo
        return (self.leto, self.mesec, self.dan) \
               == (other.leto, other.mesec, other.dan)

    def danVLetu(self):
        return sum(dolzineMesecev(self.leto)[:self.mesec - 1]) + self.dan

    def razlika(self, other):
        # izračun se poenostavi, če predpostavimo, da je self kasnejši datum
        # če ni, izračun obrnemo
        if self < other:
            return -other.razlika(self)
        else:
            # najprej preštejemo število dni v med začetkoma let
            razlika = sum(steviloDni(l) for l in range(other.leto, self.leto))
            # nato upoštevamo še dni v posameznem letu
            razlika += self.danVLetu()
            razlika -= other.danVLetu()
            return razlika

    def danVTednu(self):
        # uporabimo Zellerjev obrazec
        q = self.dan
        # upoštevamo popravek za januar in februar
        if self.mesec > 2:
            m = self.mesec
            l = self.leto
        else:
            m = self.mesec + 12
            l = self.leto - 1
        j = l // 100
        k = l % 100
        h = (q + ((m + 1) * 26) // 10 + k + k // 4 + j // 4 - 2 * j) % 7
        # popravimo vrednost h, da bo 1 ponedeljek in 7 nedelja
        return (h - 2) % 7 + 1

    def tedenVLetu(self):
        # kateri dan v letu je bila pretekla nedelja
        nedelja = self.danVLetu() - self.danVTednu()
        # število tednov je ravno število preteklih nedelj + 1.
        return nedelja // 7 + 2

def vsota(dmn, euv):
    (d,m,n) = dmn
    (e,u,v) = euv
    assert (m == u and n == v)
    f = {}
    for (ij,x) in d.items(): f[ij] = f.get(ij,0) + x
    for (ij,y) in e.items(): f[ij] = f.get(ij,0) + y
    f = {ij:x for (ij,x) in f.items() if x != 0}
    return (f,m,n)

