            razlika += self.danVLetu()
            razlika -= other.danVLetu()
            return razlika

class Datum(Datum):
    def tedenVLetu(self):
        # kateri dan v letu je bila pretekla nedelja
        nedelja = self.danVLetu() - self.danVTednu()
        # število tednov je ravno število preteklih nedelj + 1.
        return nedelja // 7 + 2

